	public static function getParams($group, $url_key, $cpc, $country, $mode): array {
		$params = [];

		if ($mode === self::MODE_FIRST) {
			$params = [
				'name'        => date('d_m_y_') . $country . '_' . $url_key,
				'title'       => self::titles[$group][0],
				'description' => self::description[$group][0],
				'url'         => self::websites[$url_key],
				'image'       => self::images[$group][0],
				'icon'        => self::icons[$group][0],
				'country'     => $country,
				'cpc'         => number_format(Helper::getNum($cpc), 2),
			];
		}
		return $params;
	}
